import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { useNavigate, useParams } from 'react-router-dom';
import '../CSS folder/style.css'


export default function Dashboard() {

  let navigateTo = useNavigate();
 
  const id = useParams();

  const [student, setStudent] = useState([]);

  const getStudentDetails = async () => {

    // e.preventDefault();
    await axios.get(`http://localhost:4000/getStudentById/${id}`)
              .then((result) => {
                console.log(result.data);
                setStudent(result.data);
              });
  }

  useEffect(() => {
    getStudentDetails();
  }, []);

  const handleLogout = (e) => {
    // e.preventDefault();
    setStudent([]);
    navigateTo('/');
  };

  return (
    <>
      <div className="wrapper">
        <div className="inner">
          <form action="">
            <h3>  Dashboard  </h3>
            <p>Student Dashboard</p>
            <div>
              {/* {student.map((existingStud, index) => {
                <tr>
                  <th>Name :- {index} {existingStud.name}</th>
                  <th>Email :- {existingStud.email}</th>
                  <th>Password :- {existingStud.password}</th>
                </tr>
                
              })} */}
              <tr>
                  <th>Name :- {student.name}</th>
                  <th>Email :- {student.email}</th>
                  <th>Password :- {student.password}</th>
                </tr>
            </div>
            <button onClick={ handleLogout }>Logout</button>
          </form>
        </div>
      </div>
    </>

  )
}
